import React from "react";
import style from "./About.module.css";

const About = () => {
  return (
    <div>
      <h1 className={style.text}>Hola mundo</h1>
      <p className={style.p}>
        Lorem ipsum dolor sit amet consectetur adipisicing elit. Autem accusamus
        obcaecati veritatis rem magnam, corrupti quam in quos ratione fugit
        quisquam natus? Veniam voluptates accusantium distinctio, delectus
        harum, ea animi inventore facilis fugit similique quis qui voluptatem
        deleniti ratione temporibus saepe nemo eaque. Corporis omnis numquam
        repudiandae temporibus nostrum sunt.
      </p>
    </div>
  );
};

export default About;
